import "./Product.css";
import image from "../../images/Hunter-Nam/01_e07b5f71bd82468da19d879d25014315_medium.jpg";
export default function Product() {
  return (
    <div className="product_item">
      <div className="product_item-image">
        <img src={image} alt="image" />
      </div>
      <div className="product_item-sizebox">
        <span className="product_item-size">+ 7 Size</span>
      </div>
      <a href="#" className="product_item-name">
        Giày Thể Thao Nam Biti’s Hunter Street Z Collection Low W&B DSMH06600TRG
      </a>
      <a href="#" className="product_item-productType">
        Hunter Nam
      </a>
      <span className="product_item-price">699000 đ</span>
      <button className="product_item-addToCart">Mua Hàng</button>
    </div>
  );
}
